import React, {useState, useEffect } from "react";
import { Table, Button } from 'react-bootstrap';

import api from "../../services/api";



interface IDoctor{
  ID:string
  NOME: string;
  CRM: number;
  TELFIXO:number;
  TELCELULAR:number;
  BAIRRO:string;
  UF:string;
  LOCALIDADE:string;
}


const Doctors: React.FC = () => {

  var num = 0;

    const [doctors,setDoctors] = useState<IDoctor[]>([]);

    useEffect(()=>{
        loadDoctors();
    },[])

    async function loadDoctors(){
        const response = await api.get('/InfoDoctorsSpecialties/')
        console.log(response);

        setDoctors(response.data);
    }

  return (
    <div className="container">
      <br />
      <div className="Header-doctors">
      <h1>Medicos</h1>
      <Button va></Button>

      </div>
      <br />
      <Table striped bordered hover>
        <thead>
          <tr>
            <th>Nome</th>
            <th>CRM</th>
            <th>Tel. Celular</th>
            <th>Tel. Fixo</th>
            <th>Bairro</th>
            <th>Cidade</th>
            <th>Estado</th>
            <th>Ações</th>
          </tr>
        </thead>
        <tbody>
          {

            doctors.map(doctor =>(
              <tr key={num ++}>
              <td>{doctor.NOME}</td>
              <td>{doctor.CRM}</td>
              <td>{doctor.TELCELULAR}</td>
              <td>{doctor.TELFIXO}</td>
              <td>{doctor.BAIRRO}</td>
              <td>{doctor.LOCALIDADE}</td>
              <td>{doctor.UF}</td>
              <td>
                <Button size='sm' variant="warning">Editar</Button>{' '}
                <Button size='sm' variant="success">Visualizar</Button>{' '}
                <Button size='sm' variant="danger">Remover</Button>{' '}
              </td>
            </tr>
            ))

          }

        </tbody>
      </Table>
    </div>
  );
};

export default Doctors;
